import Link from 'next/link';

import Layout from '../components/Layout';

const PostLink = props => (
  <Link href={`/post?title=${props.title}`}>
    <a>{props.title}</a>
  </Link>
);

export default function index() {
  return (
    <Layout>
      <p>Hello World</p>
    </Layout>
  );
}
